import { configureStore } from "@reduxjs/toolkit";
import { Role } from "./slice/Slice";
import  { multilevel } from "./slice/Multilevel";
const Store = configureStore({
  reducer: { 
    Role :Role.reducer,
  multilevel:multilevel.reducer
  },
});
export default Store;
